import React from 'react';
import logo from './logo.svg';
import map from './mapOfLocations.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        // <img src={logo} className="App-logo" alt="logo" />
        <img src={map} className="App-mapOfLocations" alt="mapOfLocations"/>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
